import React from 'react'
let ViewContact = ()=>
{
    return(
        <React.Fragment>
            <section className="view-contact">
                <div className="container">
                    <div className="row">
                        <div className="col">
                            <p className="h3 test-q">View Contact</p>
                        </div>
                    </div>

                </div>

            </section>
            
        </React.Fragment>

    )
};
export default ViewContact;
